import numpy as np
import openpyxl

def save(row, col, result):
    # xlsx_path = 'Result/AAAI Data/special_modulary.xlsx'  # xlsx路径
    data = openpyxl.load_workbook(xlsx_path)
    sheetnames = data.sheetnames
    # table = data[sheetnames[4]] # 指定xlsx表中的sheet
    table = data.active
    r, c = row, col
    for i in range(len(result)):
        table.cell(r, c).value = result[i]
        r = r+1

    data.save(xlsx_path)

def get_acc(r, c, xlsx_path, id=0):
    re = []
    data = openpyxl.load_workbook(xlsx_path)
    sheetnames = data.sheetnames
    table = data[sheetnames[id]]  # 指定xlsx表中的sheet
    # table = data.active
    for i in range(400):
        re.append(table.cell(r, c).value)
        r += 1
    data.save(xlsx_path)
    return re


def save_acc(row, col, result, xlsx_path, id=0):
    data = openpyxl.load_workbook(xlsx_path)
    sheetnames = data.sheetnames
    table = data[sheetnames[id]] # 指定xlsx表中的sheet
    # table = data.active
    r, c = row, col
    t = 0
    for i in result:
        table.cell(r, c).value = i
        r, t = r+1, t+1
        if t % 20 == 0:
            r, c = row, c+1
    data.save(xlsx_path)


def save_tmp(row, col, seg, result, xlsx_path):
    data = openpyxl.load_workbook(xlsx_path)
    sheetnames = data.sheetnames
    table = data[sheetnames[0]] # 指定xlsx表中的sheet
    # table = data.active
    r, c = row, col
    t = 0
    for i in result:
        table.cell(r, c).value = i
        r, t = r+1, t+1
        if t % seg == 0:
            r, c = row, c+1

    data.save(xlsx_path)

